// (기본 React 생성 파일 - 수정됨)
import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
// import reportWebVitals from './reportWebVitals'; // [수정] 이 줄을 주석 처리 (파일 없음)

